As reported in JENKINS-50375, any selection made inside the stage logs is immediately de-selected.
It seems that the click handler handles clicks on the entire element, and is triggered also when a user clicks and drags to create a selection. (the handler removes and replaces the content, voiding selected text before a user can copy it)
This proposed change adds a check to see if the user has selected text, and if so exits the handler early.
onElement.click(function() {
+        // Stop if the user clicked to select some text.
+       if (window.getSelection().toString() != "") {
+            return;
+        }
There could be other possible fixes. For example, this alternative suggestion narrows the click handler scope to only clicks in the top part of the element.
-    onElement.click(function() {
+    var $ = jqProxy.getJQuery();
+    $('.node-name', onElement).click(function() {
Testing done
Not yet tested in-place, I have not had the chance to set up a sandbox Jenkins server.
I have set breakpoints on the existing code and checked the behaviour of eg window.getSelection() manually.

